import React from "react";
import { Carousel, ListGroup, Nav, Navbar, Container, NavDropdown} from 'react-bootstrap';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import 'bootstrap/dist/css/bootstrap.min.css';


function inicio(){
    return(
        <div className="Inicio">
        {/* Empezando el NavBar */}
            <Navbar variant="dark" expand="lg" collapseOnSelect id="NavBar">
                <Navbar.Toggle/>
                <Navbar.Collapse>
                <Nav id="NavItems">
                    <Nav.Link><Link to="/">Inicio</Link></Nav.Link>
                    <Nav.Link><Link to="/Comics">Comics</Link></Nav.Link>
                    <Nav.Link><Link to="/Informacion">Informaci√≥n</Link></Nav.Link>
                </Nav>
                </Navbar.Collapse>
            </Navbar>
        {/* Finalizando el NavBar */}    
        </div>
    );
}

export default inicio;
